CREATE TABLE `t_status` (
  `resourceID` int(4) NOT NULL DEFAULT '0',
  `userID` int(4) NOT NULL DEFAULT '0',
  `res_basic` enum('optional','incomplete','unchanged','complete') NOT NULL DEFAULT 'incomplete',
  `res_descriptions` enum('optional','incomplete','unchanged','complete') NOT NULL DEFAULT 'optional',
  `res_contacts` enum('optional','incomplete','unchanged','complete') NOT NULL DEFAULT 'incomplete',
  `res_keywords` enum('optional','incomplete','unchanged','complete') NOT NULL DEFAULT 'optional',
  `res_serviceLocations` enum('optional','incomplete','unchanged','complete') NOT NULL DEFAULT 'incomplete',
  `res_certs` enum('optional','incomplete','unchanged','complete') NOT NULL DEFAULT 'incomplete',
  `res_attrs` enum('optional','incomplete','unchanged','complete') NOT NULL DEFAULT 'incomplete',
  `res_homeorgs` enum('optional','incomplete','unchanged','complete') NOT NULL DEFAULT 'incomplete',
  `overallState` enum('modified','tobeapproved','tobedeleted') NOT NULL DEFAULT 'modified',
  `res_monitors` enum('optional','incomplete','unchanged','complete') NOT NULL DEFAULT 'incomplete',
  PRIMARY KEY (`resourceID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='Contains status of temporary resources';
